css:
@-moz-document domain('tumblr.com') {

div.reblog-header > a.reblog-avatar,
div.post_wrapper > div.post_content.clearfix > div > div.reblog-list > div.reblog-list-item.original-reblog-content > div.reblog-header,
img .reblog-avatar-image-thumb {
	visibility: hidden;
	width: 0;
	height: 0;
	margin: 0;
	padding: 0;
}

div.reblog-header{
	padding-left: 0!important;
}
div.reblog-list > div > div.reblog-content {
  	padding: 0 15px;
	border-left: 2px #eaeaea solid!important;
    border-bottom: none!important;
}
div > div.reblog-list-item.contributed-content,
.contributed-content {
  	border-top: none!important;
}
div.post_wrapper > div.post_content.clearfix > div > div.reblog-list > div {
 	border-bottom: none!important;
}
a .reblog-tumblelog-name,
div.reblog-header > a.reblog-tumblelog-name.post_info_link{
    font-weight: normal!important;
    border-bottom: 1px solid #eaeaea;
	padding-bottom: 2px;
    font-size: 14px;
}
  
}
